description:
Jessica and Dick (Jessie Andrews and Dale Dabone) live together in a sweet, love-filled house, until the house next door becomes invaded by the wild young couple Rachel and Frank (Lily Carter and Richie Deville). Jessica welcomes the new neighbors, but what she doesn't know is that Dick and Rachel aren't exactly strangers. Scandal, lies and forbidden sex rock the suburbs in Sweet Sinner's explosive The Neighbors!

